import React, { Component } from 'react';
import Tab from './Components/TabList'
import Body from './Components/Body'

export class App extends Component {
  render(){
    const tabs = [
      {
        id:1,
        title:'Home'
      },
      {
        id: 2,
        title:'Images'
      },
      {
        id:3,
        title:'Videos'
      }
    ]
    return(
      <div className="body">
        <div className="nav-bar">
        <Tablist tabs={tabs}/>
        </div>
        <div className="main-body">
        <Body/>
        </div>
      </div>
    );
  }
}

export default App;
